import React, { useState } from "react";
import axios from "axios";
import {
  Box,
  Typography,
  TextField,
  Button,
  Grid,
  Link,
  IconButton,
  InputAdornment,
  FormControl,
  styled
} from "@mui/material";
import { Visibility, VisibilityOff } from "@mui/icons-material";
import { Snackbar } from "@mui/material";
import Alert from "@mui/material/Alert";
import CloseIcon from "@mui/icons-material/Close";

const AuthBox = styled(Box)(({ theme }) => ({
  position: "absolute",
          left: "50%",
          top: "50%",
          transform: "translate(-50%, -50%)",
          background: "rgba(66,66,66,0.25)",
          color: "rgb(255 255 255 / 100%)",
          padding: '16px',
          borderRadius: '8px',
    [theme.breakpoints.up("xs")]: {
      width: "330px",
      marginTop: '15px'
    },
    [theme.breakpoints.up("sm")]: {
      width: "500px",
    },
  }
));

const AuthPage = () => {
  const [form, setForm] = useState({
    email: "",
    password: "",
    returnPassword: "",
    showPassword: false,
  });

  const changeHandler = (event) => {
    setForm({ ...form, [event.target.name]: event.target.value });
  };

  const handleClickShowPassword = () => {
    setForm({
      ...form,
      showPassword: !form.showPassword,
    });
  };

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };

  const check = () => {
    if (form.password === form.returnPassword) {
      if (form.password.length > 6) {
        registerHandler();
      } else {
        handleClickPassword();
      }
    } else {
      handleClickPasswordSuccess();
    }
  };

  const registerHandler = async () => {
    try {
      await axios
        .post(
          "/api/auth/registration",
          { ...form },
          {
            headers: {
              "Content-Type": "application/json",
            },
          }
        )
        .then((res) => {
          setTimeout(() => {
            window.location.href = "/auth";
          }, 2000);
        });
    } catch (errors) {
      if (errors.message === "Request failed with status code 300") {
        handleClick();
      }

      if (errors.message === "Request failed with status code 400") {
        handleClickCode();
      }
    }
  };

  const [open, setOpen] = React.useState(false);
  const [openCode, setOpenCode] = React.useState(false);
  const [openCodeSuccess, setOpenCodeSuccess] = React.useState(false);
  const [openPassword, setOpenPassword] = React.useState(false);
  const [openPasswordSuccess, setOpenPasswordSuccess] = React.useState(false);

  // Отслеживания для алертов
  const handleClick = (message) => {
    setOpen(true);
  };

  const handleClickCode = (message) => {
    setOpenCode(true);
  };

  const handleClickCodeSuccess = (message) => {
    setOpenCodeSuccess(true);
  };

  const handleClickPassword = (message) => {
    setOpenPassword(true);
  };

  const handleClickPasswordSuccess = (message) => {
    setOpenPasswordSuccess(true);
  };

  //Закрытие алертов
  const handleClose = (event, reason) => {
    if (reason === "clickaway") {
      return;
    }

    setOpen(false);
  };

  const handleCloseCode = (event, reason) => {
    if (reason === "clickaway") {
      return;
    }

    setOpenCode(false);
  };

  const handleCloseCodeSuccess = (event, reason) => {
    if (reason === "clickaway") {
      return;
    }

    setOpenCodeSuccess(false);
  };

  const handleClosePassword = (event, reason) => {
    if (reason === "clickaway") {
      return;
    }

    setOpenPassword(false);
  };

  const handleClosePasswordSuccess = (event, reason) => {
    if (reason === "clickaway") {
      return;
    }

    setOpenPasswordSuccess(false);
  };

  const action = (
    <React.Fragment>
      <Button color="secondary" size="small" onClick={handleClose}>
        UNDO
      </Button>
      <IconButton
        size="small"
        aria-label="close"
        color="inherit"
        onClick={handleClose}
      >
        <CloseIcon fontSize="small" />
      </IconButton>
    </React.Fragment>
  );

  return (
    <Box className="container">
      <Snackbar
        open={open}
        autoHideDuration={6000}
        onClose={handleClose}
        message="Ошибка входа"
        action={action}
      >
        <Alert onClose={handleClose} severity="error" sx={{ width: "100%" }}>
          Пользователь с таким email уже зарегистрирован!
        </Alert>
      </Snackbar>
      <Snackbar
        open={openCode}
        autoHideDuration={6000}
        onClose={handleCloseCode}
        message="Неверный email"
        action={action}
      >
        <Alert
          onClose={handleCloseCode}
          severity="error"
          sx={{ width: "100%" }}
        >
          Неверный email!
        </Alert>
      </Snackbar>
      <Snackbar
